import React, { Component } from 'react';
import TopNavRightIcon from './TopNavRightIcon';
import TopNavRightSelect from './TopNavRightSelect';


class TopNavRight extends Component {
     
    render() {
        return (
                <div className="col-lg-6 col-md-6 col-sm-12 col-xs-12">
                    
                        <TopNavRightSelect option="سجل هنا"/>
                        <TopNavRightSelect option="الاشتراك"/>
                    
                    <TopNavRightIcon  href="tel:01028496209" title="Call me" id="mobile" media="01028496209" className="fas fa-phone-alt"/>
                    <TopNavRightIcon  href="mailto:info@yourdomain.com" title="Mail" media="info@yourdomain.com" className="far fa-envelope"/>
                </div>
        )
    };
}
export default TopNavRight;
